let right=true // Acts as a switch (if true: go left, if false: go right)
let counter = 0
let count = 2

setInterval(()=>{ // Starts intervals
    if(right){
    feature.scale.x = feature.scale.x - 0.01 // move to the left (or north)
    counter = counter + 1
    if(counter > count){    
    right = !right
    counter = 0    
      }    
  }else{
    feature.scale.x = feature.scale.x + 0.01 // move to the right (or south)
    counter = counter + 1
    if(counter > count){    
    right = !right
    counter = 0    
      }    
  }
},3)

